Dear hange...
I'm going to say it all today. You were the first anime female I ever had a crush on. I love everything about you..your personality, your smartness, optimism, sweetness, cuteness absolutely everything. For me, you arent a fictional character. 
You are a real person.
You taught me to keep my hopes high in the darkest times, and taught me always be curious about things, keep learning new stuff everyday. As someone who doesnt really like science, you changed that fact. 
You're pretty, beautiful, charismatic, and with a golden heart. 
This was...unexpected. 
  But now with what has happened.... I'm gonna miss you. 
We all are gonna miss you. 
But you'll be in our hearts forever. 
We will always love you.
Thank you for everything, han- "4 eyes."
Your sacrifice was not in vain. 
Love you always.
"Later, hange...."

-sincerely, a hange stan.
